description:
Verenigde Staten / Frankrijk
Actie / Mystery
93 minuten

een goeie film

met Jake Gyllenhaal, Vera Farmiga en Michelle Monaghan

Colter Stevens (Jake Gyllenhaal) wordt met een schok wakker in een trein op weg naar Chicago. Hoewel de passagiers hem lijken 
te kennen heeft hij geen idee waar - of wie - hij is. Het laatste wat hij zich herinnert is een helikoptermissie in Afghanistan.
Nu zit hij in het lichaam van iemand anders, maar voor hij iets kan doen vernietigt een bomexplosie het complete treinstel en 
alle passagiers...
